import React from "react";
import { useSelector } from "react-redux";
import { useParams } from "react-router-dom";
import { Container, Form, Col, Row } from "react-bootstrap";
import "./grid.css";
const RealizarReservacion = () => {
  const { cant } = useParams();
  const state = useSelector((state) => state);
  const { cantidad } = state.reservacion;
  console.log("ver cantidade", cantidad);

  return (
    <Container>
      <div>
        <p>Reservaciones:{cant}</p>
      </div>
      <Form>
        <Row>
          <Col xs={12} md={6}>
            <Form.Group>
              <Form.Label className="label">
                <b>Hora</b>
              </Form.Label>
              <Form.Control placeholder="Entre La fecha"></Form.Control>
            </Form.Group>
          </Col>
          <Col xs={12} md={6}>
            <Form.Group>
              <Form.Label className="label">
                <b>Viaje</b>
              </Form.Label>
              <Form.Control
                controlId="exampleForm.ControlInput1"
                placeholder="Entre La fecha"
              ></Form.Control>
            </Form.Group>
          </Col>
        </Row>

        <div className="grid">
          {cantidad.map((cant, index) => (
            <Form.Group>
              <Form.Label className="label">
                <b>CI {index + 1}:</b>
              </Form.Label>
              <Form.Control placeholder="Entre La fecha"></Form.Control>
            </Form.Group>
          ))}
        </div>
      </Form>
    </Container>
  );
};

export default RealizarReservacion;
